sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
var fundsArray=inputs.req.product.funds;
var jObj=inputs.jObj;
var array=[];

if(inputs.jObj.productOptions.fund.funds.name!=""){
jObj.productOptions.fund={};
jObj.productOptions.fund.funds=[]
fundsArray.forEach(function(element){
    var obj={
        "code":element.name,
        "percent":element.value
    }
    array.push(obj);
})
jObj.productOptions.fund.funds=array;
outputs.response=jObj;
}
else{
    outputs.response=jObj;
}

})(inputs, outputs);

